            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
        </div>
        <div className="analysis__field">
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
        </div>
        <div className="analysis__field">
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
        </div>
        <div className="analysis__field">
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
        </div>
      </div>
    </Grid>
  );
}

function MainVideo({ videoSrc }) {
  return (
    <Grid item xs={12} md={5} justify="center" alignItems="center">
      <div className="main__video">
        <video className="video" width="100%" controls>
          <source src={videoSrc} type="video/mp4" />
        </video>
      </div>
    </Grid>
  );
}
function TiltShape() {
  return (
    <div class="custom-shape-divider-top-1624904894">
      <svg
        data-name="Layer 1"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 1200 120"
        preserveAspectRatio="none"
      >
        <path
          d="M1200 120L0 16.48 0 0 1200 0 1200 120z"
          class="shape-fill"
